[{'comment_id': 433560788, 'comment_body': 'This file needs to get bigger and more detailed. Take a look at the README in jsonexample for a model:

https://github.com/flutter/samples/blob/master/jsonexample/README.md', 'comment_created': datetime.datetime(2020, 6, 2, 0, 41, 26, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 433560855, 'comment_body': 'nit: Throw a newline on this.', 'comment_created': datetime.datetime(2020, 6, 2, 0, 41, 40, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 433561596, 'comment_body': 'We generally use "dev.flutter" or "dev.flutter.example" as the org. You should be able to run:

   flutter create --org="dev.flutter" .

in the project directory to change it.', 'comment_created': datetime.datetime(2020, 6, 2, 0, 44, 51, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 433563283, 'comment_body': "Typically we'd make a simple data class for this rather than using maps, so you'd have `List<DemoData>` rather than `List<Map<String, String>>`.", 'comment_created': datetime.datetime(2020, 6, 2, 0, 51, 47, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 433563455, 'comment_body': "Did you consider using a ListView here? While it's unlikely to matter in this case, ListView is significantly more performant than a scrolling Column.", 'comment_created': datetime.datetime(2020, 6, 2, 0, 52, 38, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 433563537, 'comment_body': 'nit "responsible for displaying"', 'comment_created': datetime.datetime(2020, 6, 2, 0, 52, 53, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 433564075, 'comment_body': "If the constructor accepts a key, it should pass it along to the super class constructor. For example:

https://github.com/RedBrogdon/rebloc/blob/master/lib/src/widgets.dart#L24

Also, it looks like this widget needs the demoTitle and demoRoute parameters to be set, so consider making them positional, rather than named optional parameters. You could also add asserts to make sure they're not null.", 'comment_created': datetime.datetime(2020, 6, 2, 0, 54, 53, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 433569317, 'comment_body': 'I believe the code in this method could be tightened up a bit and made more readable. Consider trying the following:

* Rather than declaring `count` without initializing it, fill it with `call.argument<Int>("count")` right away.
* Check to see if the value is null, and if it is, call `result.error` right away.
  - For readability, it's good to put argument error conditions as high in the function as possible, rather than separating them from the condition and putting them at the bottom.
  - With the check done, count will be promoted to non-nullable automatically, so you won't have to worry about using `!!`.
* Try removing any unnecessary braces in the `when` statement.
  - You could also call `result.success` from inside the `when`, which saves you from needing to do it later (and I think makes it possible for `count` to be a `val` rather than a `var`.', 'comment_created': datetime.datetime(2020, 6, 2, 1, 16, 12, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 433627960, 'comment_body': 'Do these two methods need to be static?', 'comment_created': datetime.datetime(2020, 6, 2, 5, 27, 48, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 433628596, 'comment_body': "I'm not sure you need this comment block. There's a weird subtly to adding comments to sample code. One the one hand, it can help people figure out what's going on, but on the other it adds length to the overall file and doesn't help those who aren't very accustomed to speaking English.

Typically we tend to add comments that explain functionality specific to the particular app (in other words, nothing that you could just as easily find in the SDK docs). For that reason, I'd recommend cutting this part, since it's mostly just explaining what `invokeMethod` does.", 'comment_created': datetime.datetime(2020, 6, 2, 5, 30, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 433629143, 'comment_body': "nit: this is a style concern, and several of the other contributors to the repo disagree with me, but I generally avoid using underscores for unused parameter names. While they're perfectly fine in normal code, a reader here might like to know what data that parameter normally holds. Using a real name (even something like `ex` here) can give them a hint as they read.", 'comment_created': datetime.datetime(2020, 6, 2, 5, 31, 50, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 433629436, 'comment_body': 'Why is the code trapping these exceptions? Would it not be better just to let them escape so that the UI can present the error message?', 'comment_created': datetime.datetime(2020, 6, 2, 5, 32, 51, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 433629745, 'comment_body': 'You can get around the need for this key by wrapping the body of your scaffold in a builder widget, which will provide a new BuildContext below the Scaffold.', 'comment_created': datetime.datetime(2020, 6, 2, 5, 33, 58, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 433629844, 'comment_body': 'You can also just initialize count to 0 right in its declaration and get ride of this override.', 'comment_created': datetime.datetime(2020, 6, 2, 5, 34, 20, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 433630139, 'comment_body': 'Start is the default, so you can actually leave this out.', 'comment_created': datetime.datetime(2020, 6, 2, 5, 35, 14, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 433630664, 'comment_body': "I believe that if one is going to have two FABs, they should be a in a Column. At least that's the example they show on the Material site:

https://material.io/components/buttons-floating-action-button", 'comment_created': datetime.datetime(2020, 6, 2, 5, 37, 13, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 433630861, 'comment_body': 'This method can be made async, which will allow you to use await and try/catches.', 'comment_created': datetime.datetime(2020, 6, 2, 5, 37, 53, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 433631042, 'comment_body': 'Would a Center widget work here rather than a Container?', 'comment_created': datetime.datetime(2020, 6, 2, 5, 38, 30, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 433829392, 'comment_body': "I did consider using a `ListView`, but I think we won't have many DemoTile's on the screen. I'm using `SingleChildScrollView` just to be on safer side in case if user is testing in small device.", 'comment_created': datetime.datetime(2020, 6, 2, 12, 14, 35, tzinfo=datetime.timezone.utc), 'commenter': 'AyushBherwani1998', 'type': 'User'}, {'comment_id': 433830501, 'comment_body': 'Thank you for the suggestions. Yes, we can make count be val instead of var and send the value like `result.success(count + 1).', 'comment_created': datetime.datetime(2020, 6, 2, 12, 16, 45, tzinfo=datetime.timezone.utc), 'commenter': 'AyushBherwani1998', 'type': 'User'}, {'comment_id': 433832195, 'comment_body': 'I was avoiding to create an object of `Counter` and then use the object to access the methods. ', 'comment_created': datetime.datetime(2020, 6, 2, 12, 19, 58, tzinfo=datetime.timezone.utc), 'commenter': 'AyushBherwani1998', 'type': 'User'}, {'comment_id': 433832521, 'comment_body': "Yes, I was also unsure about that. Thanks for pointing out. I'll remember this for next iterations.", 'comment_created': datetime.datetime(2020, 6, 2, 12, 20, 34, tzinfo=datetime.timezone.utc), 'commenter': 'AyushBherwani1998', 'type': 'User'}, {'comment_id': 433832997, 'comment_body': 'Makes sense, using `catchError` now to show the specific error message.', 'comment_created': datetime.datetime(2020, 6, 2, 12, 21, 24, tzinfo=datetime.timezone.utc), 'commenter': 'AyushBherwani1998', 'type': 'User'}, {'comment_id': 433835471, 'comment_body': "I did the same thing. First, I was using `Builder` to have a different context, thinking that GlobalKey is a little more expensive, but I switch to GlobalKey so that I have to pass less arguments. 

I'll again use the `Builder` instead of `GlobalKey`.", 'comment_created': datetime.datetime(2020, 6, 2, 12, 25, 59, tzinfo=datetime.timezone.utc), 'commenter': 'AyushBherwani1998', 'type': 'User'}, {'comment_id': 433896163, 'comment_body': 'I was thinking to add a detailed README after the project. As of now, I have improved it taking the base from other samples in the repo.', 'comment_created': datetime.datetime(2020, 6, 2, 13, 58, 5, tzinfo=datetime.timezone.utc), 'commenter': 'AyushBherwani1998', 'type': 'User'}, {'comment_id': 434298845, 'comment_body': 'The new stuff looks great. The only additional suggestion I have is to add a line just before "Goals" that says "This sample is currently being built. Not all platforms and functionality are in place."', 'comment_created': datetime.datetime(2020, 6, 3, 4, 19, 23, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 434298989, 'comment_body': 'nit: "to listen to continuous value changes from the platform."', 'comment_created': datetime.datetime(2020, 6, 3, 4, 19, 58, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 434299320, 'comment_body': 'This looks great. Much tighter code.', 'comment_created': datetime.datetime(2020, 6, 3, 4, 21, 19, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 434299445, 'comment_body': 'Discussed offline, and we decided to go with a ListView.', 'comment_created': datetime.datetime(2020, 6, 3, 4, 21, 57, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 434299597, 'comment_body': "SGTM. It's more a style choice rather than anything.", 'comment_created': datetime.datetime(2020, 6, 3, 4, 22, 37, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 434299984, 'comment_body': 'nit: "...to display its value."', 'comment_created': datetime.datetime(2020, 6, 3, 4, 24, 24, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 434300062, 'comment_body': 'Nice refactor. Builder has saved me a lot of keys. :)', 'comment_created': datetime.datetime(2020, 6, 3, 4, 24, 44, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 434300172, 'comment_body': 'nit: "...users press the..."', 'comment_created': datetime.datetime(2020, 6, 3, 4, 25, 9, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 434300420, 'comment_body': "This shouldn't be necessary. Try taking it out and see if everything still works. :)", 'comment_created': datetime.datetime(2020, 6, 3, 4, 26, 7, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 434302524, 'comment_body': "I believe I had a comment in this section earlier, but just in case: typically I would expect to see an async method here. Generally we recommend using async/await over the Futures API whenever possible. 

The logic can all stay the same; it's just a syntactical change:

```dart
onPressed: () async {
  try {
    final value = await Counter.increment(counterValue: count);
    setState(() => count = value);
  } catch (error) {
    showErrorMessage(
      context,
      error.message as String,
    );
  }
},
```", 'comment_created': datetime.datetime(2020, 6, 3, 4, 35, 45, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 434448398, 'comment_body': 'I missed it in the previous commit after doing the changes.', 'comment_created': datetime.datetime(2020, 6, 3, 9, 53, 25, tzinfo=datetime.timezone.utc), 'commenter': 'AyushBherwani1998', 'type': 'User'}, {'comment_id': 434935961, 'comment_body': "There are a number of places you can put this sort of setup code. Inside at the top of main is fine, and there's also a `setUpAll` method that you can use to put code that needs to be called once before all the tests. The only thing I'd really recommend is to keep the declaration of `methodChannel` and this assignment in the same spot in the code, since they're directly related to one another.", 'comment_created': datetime.datetime(2020, 6, 4, 1, 4, 18, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 434951706, 'comment_body': "@RedBrogdon I moved the code to register `MethodCallHandler` inside the `testWidgets` because I wanted to make sure I was accessing the `ServicesBinding.defaultBinaryMessenger` after the binding was initialized in `testWidgets`. If I register the mock in main, I had to use `TestWidgetsFlutterBinding.ensureInitialized`.

But, that's a good suggestion, I can use `setUpAll`.", 'comment_created': datetime.datetime(2020, 6, 4, 2, 7, 9, tzinfo=datetime.timezone.utc), 'commenter': 'AyushBherwani1998', 'type': 'User'}, {'comment_id': 434953457, 'comment_body': "I'll do the required changes; I'll use the `setUpAll` inside the `group` to register the mock for `MethodCallHandler`.", 'comment_created': datetime.datetime(2020, 6, 4, 2, 13, 54, tzinfo=datetime.timezone.utc), 'commenter': 'AyushBherwani1998', 'type': 'User'}, {'comment_id': 435574361, 'comment_body': "Got it. You're right, that makes total sense. `setUpAll` should prevent you from any similar problems in the future (at least in this file).", 'comment_created': datetime.datetime(2020, 6, 4, 21, 54, 26, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}]

[{'comment_id': 440527592, 'comment_body': 'nit:

        // Registers a MessageHandler for BasicMessageChannel to receive
        // a message from Dart and send image data in reply.', 'comment_created': datetime.datetime(2020, 6, 16, 1, 1, 31, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 440527827, 'comment_body': 'nit: Copyright header needed.', 'comment_created': datetime.datetime(2020, 6, 16, 1, 2, 24, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 440528016, 'comment_body': 'I believe there should be a whitespace line between these two imports, since one comes from the Dart SDK and one is from a package.', 'comment_created': datetime.datetime(2020, 6, 16, 1, 3, 6, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 440528851, 'comment_body': 'nit: /// This class manages a [BasicMessageChannel] that can return an image loaded
/// from a native asset. The [BasicMessageChannel] uses [StandardMessageCodec]
/// since it supports [Uint8List], which is used to transport the image data.', 'comment_created': datetime.datetime(2020, 6, 16, 1, 6, 26, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 440529027, 'comment_body': 'nit: copyright header and line of whitespace after the `dart:` imports.', 'comment_created': datetime.datetime(2020, 6, 16, 1, 7, 1, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 440530097, 'comment_body': 'Have you seen FractionallySizedBox? I believe you can use it to get the look you want without the need for a MediaQuery.

https://github.com/flutter/flutter/blob/f7f019aa9410f484055aee7207cc51a61ad95ba7/packages/flutter/lib/src/widgets/basic.dart#L2300', 'comment_created': datetime.datetime(2020, 6, 16, 1, 11, 3, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 440530948, 'comment_body': "While I'm sure this code works, there's a slightly different pattern more commonly used on our team:

1) Change `imageData` to be `Future<Uint8List>` and initialize it to null.
2) In the build method, if `imageData` is null, build the PlaceHolder as you are now.
3) If it's not null, use a FutureBuilder to display the state of the future (uncompleted, completed, error).

This onPressed method would then just need to be `setState(() => imageData = PlatformImage.getImage());`, and the SDK would do the work of waiting on it to complete for you.", 'comment_created': datetime.datetime(2020, 6, 16, 1, 14, 34, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 440531148, 'comment_body': 'Consider renaming this class to something slightly more descriptive ("PlatformImageFetcher" for example).', 'comment_created': datetime.datetime(2020, 6, 16, 1, 15, 14, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 440531422, 'comment_body': 'nit: copyright header needed.', 'comment_created': datetime.datetime(2020, 6, 16, 1, 16, 14, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 442638093, 'comment_body': "nit: Now that you're not using a snackbar, you don't need this builder any more.", 'comment_created': datetime.datetime(2020, 6, 19, 5, 28, 56, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}]

