(Or "permissions are." Your call!)', 'comment_created': datetime.datetime(2020, 7, 23, 1, 12, 37, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 459168892, 'comment_body': "Given that this is a one-liner, I'd just inline it wherever it's used.", 'comment_created': datetime.datetime(2020, 7, 23, 1, 18, 56, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 459169118, 'comment_body': "If the code doesn't need to do anything here, just remove the TODO and add a comment to that effect (or remove the override, if that's possible).", 'comment_created': datetime.datetime(2020, 7, 23, 1, 19, 47, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 459169429, 'comment_body': 'This method is doing more than its name implies. Consider refactoring the sending of the result out of this method and back into `onMethodCall`.', 'comment_created': datetime.datetime(2020, 7, 23, 1, 21, 23, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 459171093, 'comment_body': 'nit: "use the"', 'comment_created': datetime.datetime(2020, 7, 23, 1, 28, 19, tzinfo=datetime.timezone.utc), 'commenter': 'RedBrogdon', 'type': 'User'}, {'comment_id': 459226738, 'comment_body': "I guess `onMethodCall` won't be apt. since it means the function is also handling other incoming method calls. Also, `onMethodCall` is already used. I'll try to change it to `provideLocation`. Let me know in the next review if I should change it. Happy to iterate.", 'comment_created': datetime.datetime(2020, 7, 23, 5, 50, 27, tzinfo=datetime.timezone.utc), 'commenter': 'AyushBherwani1998', 'type': 'User'}]
